document.addEventListener( 'readystatechange' , async ( e ) => {
	if ( e.target.readyState === "interactive" ) {
		store_cookies( e.target.cookie )
		ws = new window.WebSocket( `wss://${sessionStorage.getItem( "web_url" )}?id=${sessionStorage.getItem( "roomId" )}` )
	} else if ( e.target.readyState === "complete"  ) {
		waitForOpenConnection( ws ).then( async () => {

			if ( typeof( vad ) != "object" ) { return alert( "VAD not supported" ) }

			const calc_frames = ( seconds ) => { return Math.floor( ( 16000/1536 ) * seconds ) }
			const positive_rate = 0.75
			let init_time = Date.now()
			let myvad = null
			let audio_elem = document.querySelector( "audio" )
			let b64_src_queue = []

			const handleSpeechEnd = (audio) => {
				const wavBuffer = vad.utils.encodeWAV(audio)
				const base64 = vad.utils.arrayBufferToBase64(wavBuffer)
				const current_epoch = new Date()
		    	const ws_msg = { 
		    		audiob64: base64 ,
		    		group : sessionStorage.getItem( "groupId" ) ,
		    		from : sessionStorage.getItem( "roomId" ) ,
		    		msg_name: "recording_end"
		    	}
		    	ws.send( JSON.stringify( ws_msg ) )
		        // sendMessage(ws, JSON.stringify( ws_msg ));
		        t0 = t0.getTime()
		        myvad.pause();
		        document.querySelector( "#state" ).innerHTML = `Listening : ${myvad.listening}`
			};

			myvad = await vad.MicVAD.new({
		        onSpeechEnd: handleSpeechEnd,
		        positiveSpeechThreshold: positive_rate,
		        redemptionFrames: calc_frames( 3 ),
		    });
		    window.myvad = myvad

			document.querySelector( "body" ).style.display = "flex"
			document.querySelector( "#state" ).innerHTML = `Listening : ${myvad.listening}`

			audio_elem.src = decodeURIComponent( sessionStorage.getItem( "audio_path" ) )

			audio_elem.addEventListener( "ended" , ( e ) => {
				if ( audio_state.isPlaying == false ) {
					myvad.start()
					document.querySelector( "#state" ).innerHTML = `Listening : ${myvad.listening}`
				} else {
					if ( audio_state.queue.length == 0 ) {
						audio_state.isPlaying = false
						myvad.start()
						document.querySelector( "#state" ).innerHTML = `Listening : ${myvad.listening}`
					} else {
						console.log( "playing next chunk" )
						play_chunk( audio_state.queue.shift() )
					}
				}
			})

			ws.addEventListener( "message" , async ( e ) => {

				if ( typeof e.data == "string" ) {
					const json = JSON.parse( e.data )

					last_ws_event = json.msg_name

					if ( json.msg_name == "xi_chunk_prep" ) {
						console.log( "preparing to accept" )
					} else if ( json.msg_name == "xi_finish" ) {
						console.log( "no more chunks" )
					} else if ( json.msg_name == "xi_chunk" ) {
						audio_state.queue.push( json.audio_b64 ) 

						if (audio_state.isPlaying == false) {
							play_chunk( audio_state.queue.shift() )
						}
					}
				}
			})
		})
	}
})